	@Test
	public void testEventIntStringStringTimeStringIntBoolean() {
		final int id = 2;
		final String name = "Quedada de lectura";
		final String description = "amazing afternoon con los panas";
		final String location = "Plaza Menor";	    
	    final Timestamp day = createTime("2021-07-25 15:00:00");
		final String tag = "LECTURA";
		final int capacity = 10;
		final boolean important = true;
		final String image = "";
		final int organizer = 1;
		
		
		final Event event = new Event(id, name, description, location, day, tag, capacity, important, image, organizer);
		
		assertThat(event.getId(), is(equalTo(id)));
		assertThat(event.getName(), is(equalTo(name)));
		assertThat(event.getDescription(), is(equalTo(description)));
		assertThat(event.getLocation(), is(equalTo(location)));
		assertThat(event.getDay(), is(equalTo(day)));
		assertThat(event.getTag(), is(equalTo(tag)));
		assertThat(event.getCapacity(), is(equalTo(capacity)));
		assertThat(event.getImportant(), is(equalTo(important)));
		assertThat(event.getImage(), is(equalTo(image)));
		assertThat(event.getOrganizer(), is(equalTo(organizer)));
	}

