	@Test
	public void testEqualsObject() {
		final Event eventA = new Event(2, "Name A", "Description A","Location A",createTime("2021-07-25 15:00:00"),"LECTURA",10,true,"",1);
		final Event eventB = new Event(2, "Name B", "Description b", "Location B",createTime("2021-07-25 15:00:00"),"LECTURA",10,true,"",1);
		
		assertTrue(eventA.equals(eventB));
	}

	@Test
    public void testEqualsHashcode() {
        EqualsVerifier.forClass(Event.class)
            .withPrefabValues(Timestamp.class, createTime("2021-07-25 15:00:00"),createTime("2021-08-25 15:00:00"))
            .withIgnoredFields("name", "description","location","day","tag","capacity","important","image","organizer")
            .suppress(Warning.STRICT_INHERITANCE)
            .suppress(Warning.NONFINAL_FIELDS)
        .verify();
    }
	
	private Timestamp createTime(String time) {
		SimpleDateFormat sdf = new SimpleDateFormat("yyyy-M-dd hh:mm:ss");
	    Date date;
	    
	    Timestamp day = null;
		try {
			date = sdf.parse(time);
			day = new Timestamp(date.getTime());
		} catch (ParseException e) {
			e.printStackTrace();
		}
		
		return day;
	}
